  \"2015-09-01T18:07:42.771054\",\n\t\"name\": \"child-and-adult-care-food-program-cacfp-assessment-of-sponsor-tiering-determinations\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The (CACFP) provides reimbursements for
  nutritious meals and snacks served in family day care homes, child care centers,
  and other participating facilities and programs.  This assessment examines the accuracy
  of the classification of Family Day Care Homes (FDCHs) participating in the U.S.
  Department of Agriculture's (USDA) Child and Adult Care Food Program.  The assessment
  provides estimates of the number of FDCHs misclassified by sponsoring agencies into
  the wrong tier and the resulting erroneous payments for meals and snacks reimbursed
  at the wrong rate for program year 2013.\",\n\t\"license_title\": \"Creative Commons
